import React from "react";
import "./Portfolio.css";
import { Link } from "react-router-dom";

export default function Portfolio() {
  return (
    <div className="portfolio">
      <div className="head">
        <h1>DEVOPS Pvt LTD</h1>
        <ul>
          <li>
            <a href="" className="home">
              Home
            </a>
          </li>
          <li>
            <a href="">About</a>
          </li>
          <li>
            <a href="">Service</a>
          </li>
          <li>
            <a href="">Contact</a>
          </li>
          <li>
            <Link to="/login">Login</Link>
            <a href=""></a>
          </li>
        </ul>
      </div>
    </div>
  );
}
